title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o7978.m23 -> o7987.m24 -> o7987.m4 -> o7978.m23
  o7978.m9 -> o7987.m26 -> o7987.m24 -> o7987.m4 -> o7978.m23 -> o7987.m24
  o7978.m11 -> o7987.m1 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7978.m13 -> o7987.m1 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7987.m1 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7987.m24 -> o7987.m4 -> o7978.m23 -> o7987.m24
  o7987.m17 -> o7987.m5 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7987.m26 -> o7987.m24 -> o7987.m4 -> o7978.m23 -> o7987.m24
  o7987.m5 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7987.m2 -> o7978.m13 -> o7987.m1 -> o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4
  o7987.m4 -> o7978.m23 -> o7987.m24 -> o7987.m4

features:
  - inheritance
  - overriding
  - method
  - polymorphism

